import React from 'react'

const TrendingCoin = ({ coin }) => {
    return (
        <div className='border inline-flex'>
            <div className='font-bold text-xl'>{coin.score}</div>
            <img className='w-20' src={coin.large} alt='logo'/>
            <div className='font-medium text-xl'>{coin.name}</div>
        </div>
    )
}

const TrendingCoinList = ({ TrendingJSON }) => {
    var arrTrending = []
    TrendingJSON.forEach((coin) => {
        arrTrending.push(<TrendingCoin coin={coin} key={coin.id}/>)
    })
    return (
        <div className='h-screen'>
            {arrTrending}
        </div>
    )
}

const Home = ({ TrendingJSON }) => {
    return (
        <TrendingCoinList TrendingJSON={TrendingJSON}/>
    )
}

export default Home
